import React from 'react';

const About = () => {
  return (
    <div className="container">
      <h1>About BachaGroup</h1>
      <p>
        BachaGroup is a leading company in providing comprehensive solutions for businesses. Our mission is to drive innovation and empower organizations to achieve their goals through our expertise in multiple domains.
      </p>
      <p>
        Founded in 2010, BachaGroup has grown to become a trusted partner for clients across various industries. Our team is composed of experts dedicated to delivering high-quality services with a customer-first approach.
      </p>
      <p>
        We pride ourselves on our commitment to excellence and our ability to adapt to the changing needs of our clients.
      </p>
    </div>
  );
};

export default About;
